  [],\n\t\"revision_timestamp\": \"2013-03-15T10:17:48.334295\",\n\t\"name\": \"spatial-vegetation-data-for-capitol-reef-national-park-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This polygon feature class represents vegetation
  communities mapped at Capitol Reef National Park to an alliance or association level,
  depending on the photo signature. The polygons were generated using guidelines set
  by the Standardized National Vegetation Classification System (October 1995). Original
  lines were drawn on-screen using the DOQs collected in June of 2002 as a base map.
  Hard copy 9X9 photography was used for photo interpretation. Traditional image interpretation
  cues were used to develop the polygons, such as shape, size, pattern, tone, texture,
  color, and shadow. Additional data layers were used in aiding the interpretation,
  such as slope, hydrology, geography, and ground-collected vegetation information.
  The minimum mapping unit was 1/2 hectare. The attributed vegetation classes were
  subjected to an accuracy assessment, following which final adjustments were made
  to the vegetation classes. As with any digital layer, this layer is a representation
  of what is actually occurring on the ground. Errors are inherent in any interpretation
  of ground qualities. Due to the \"snapshot\" nature of the DOQs, this vegetation
  layer reflects conditions that existed when the imagery was collected.\",\n\t\"license_title\":
